sidebarCSS:
#root[data-color-scheme=light] {
  --frame-bg:               #F9F9FB;
  --tabs-activated-bg:      #E2E2E3;
  --tabs-activated-shadow:  none;
}

/*   NAVBAR   */
#root.root {
  --nav-btn-width:          25px;
  --nav-btn-height:         25px;
}

.NavigationBar .nav-item .len { 
  text-shadow: none;
  top: -2px
}

#root {
  --tabs-height: 36px !important;
  --tabs-title-padding: 8px;
  --tabs-font-size: 12px;
  --tabs-title-lines: 2;
}

.Tab .t-box {
  align-items: center;
  max-height: calc(var(--tabs-height) - var(--tabs-title-padding));
  overflow: hidden;
}

.Tab .title {
  font-size: var(--tabs-font-size);
  white-space: pre-wrap;
  line-height: calc((var(--tabs-height) - var(--tabs-title-padding)) / var(--tabs-title-lines));
}

#root {
  --nav-btn-width: 22px;
  --name-font-size: 12px;
  --count-font-size: 10px;
}
